function palindrome(str) {
  var reg = /[^a-z0-9A-Z]/g

  var str= str.replace(reg,"").toLowerCase()
  console.log(str)

  for(var i=0;i<str.length;i++)
  if(str[i]!=str[str.length-i-1])
  return false;

  return true;
}

palindrome("0_0");

